INSERT INTO `file` (`id`, `source`, `pertama`, `kedua`, `key`, `k-gram`, `basis`) VALUES
(1, 'Rabin Karp adalah salah satu algoritma pencarian string yang menggunakan teknik hasing dan rolling hash. Rabin karp banyak dimanfaatkan untuk melakukan pencekan plagiat sebuah file. pada aplikasi kali ini saya membuat aplikasi plagiat menggunakan algoritma rabin karp dengan 2 buah file perbandingan.', 'Rabin Karp adalah salah satu algoritma pencarian string yang menggunakan teknik hasing dan rolling hash. Rabin karp banyak dimanfaatkan untuk melakukan pencekan plagiat sebuah file. pada aplikasi kali ini saya membuat aplikasi plagiat menggunakan algoritma rabin karp dengan 2 buah file perbandingan. 3. Menentukan berapa besaran Basis Hash nya.\r\nBasis yang digunakan biasanya adalah basis 3, basis 5, basis 11. tapi pada aplikasi diberikan kebebesan untuk user untuk menentukan nilai basis. setiap nilai basis yang digunakan akan memberikan nilai yang berbeda .', 'teknik yang digunakan untuk plagiat adalah :\r\n1. Menghilangkan semua simbol dan spesial karakter dan menghapus semua spasi.\r\n2. menentukan berapa besaran K-Gram nya.\r\nMakin besar K-Gram yang digunakan makin kecil presentasi plagiatnya, dan sebaliknya begitu. makin kecil K-Gram yang di gunakankan maka makin besar juga persentase plagiatnya.', '51cb4514489f8594197c76d4ac599a8c', 5, 5);
